import React, {Component} from 'react';
import '../css/add.css';

export default class  Add extends Component {
    render() {
        return (
            <div className = "add"> 
                <button 
                    type = "button" 
                    className = "btn btn-outline-secondary" 
                    onClick = {() => this.props.onItemAdded('hello world')} > 
                    Add Item 
                </button>
            </div>
        )
    }
}
